<body style="background:#CCCCCC;font-family:sans-serif">
	<h1 style="text-align:center">TinySoundFont HTML5 MIDI Player</h1>
	<div style="text-align:center;margin:20px">Made with <a href="https://github.com/schellingb/TinySoundFont">TinySoundFont</a>, <a href="https://github.com/schellingb/TinySoundFont">TinyMidiLoader</a> and <a href="https://github.com/schellingb/ZillaLib">ZillaLib Multimedia Framework</a></div>
	<canvas id="zl_canvas" style="display:block;margin:0 auto 20px;border:2px solid black" oncontextmenu="event.preventDefault()" width="1" height="320"></canvas>
	<form style="display:block;text-align:center;margin:20px">Load Midi:&nbsp;&nbsp;<input type="file" onchange="try{if(window.load)load(2, this)}catch(e){alert('Browser not supported')}"></form>
	<div style="text-align:center;margin:20px">Switch to <a href="/TinySoundFont/CustomSoundFont.html">Player with custom SoundFont loading</a></div>
</body>

var Module =
{
	canvas: document.getElementById('zl_canvas'),
	requestWidth: 960,
	requestHeight: 320,
	openUrl: function(url) { },
	print: function(text) { },
	postRun: function()
	{
		var L = function(id)
		{
			if (id == 'NO_WEBGL') return 'Your browser or graphics card does not seem to support <a href="http://khronos.org/webgl/wiki/Getting_a_WebGL_Implementation" style="color:#000">WebGL</a>.<br>Find out how to get it <a href="http://get.webgl.org/" style="color:#000">here</a>.';
			if (id ==  'IEWEBGL') return '<br><br>On Internet Explorer older than version 11 you can try the <a href="https://github.com/iewebgl/iewebgl" style="color:#000">IEWebGL</a> plugin.';
		};
		if (parseInt(navigator.userAgent.split('MSIE').slice(-1)[0]) < 11)
		{
			Module.canvas.outerHTML = '<object id="zl_iecanvas" type="application/x-webgl" style="' + Module.canvas.style.cssText + ' " oncontextmenu="event.preventDefault()" width="0" height="0"></object>';
			Module.canvas = document.getElementById('zl_iecanvas');
		}
		if (!Module.noExitRuntime)
		{
			Module.canvas.outerHTML = '<div style="text-align:center;background-color:#FFF;color:#000;padding:1.5em;width:540px;margin:2em auto">' + L('NO_WEBGL') + (parseInt(navigator.userAgent.split('MSIE').slice(-1)[0]) < 11 ? L('IEWEBGL') : '') + '</div>';
		}
	},
};
window.onerror = function(e,u,l){alert(e);};
function load(type, field, contents)
{
	if (!Module) return;
	var isValid = false;
	if (!contents)
	{
		var file = (field && field.files && field.files.length > 0 ? field.files[0] : undefined)
		if (!file) return;
		var reader = new FileReader();
		reader.onloadend = function(evt) { load(type, field, new Uint8Array(evt.target.result)); };
		reader.readAsArrayBuffer(file);
		return;
	}

	var fn = ZLJS.malloc_string(field.files[0].name);
	var ptr = _malloc(contents.length);
	for (i = 0; i < contents.length; ++i) HEAP8[ptr+i] = contents[i];
	if (type == 1 && !_WMP_LoadSoundFont(fn, ptr, contents.length)) alert('Error loading SoundFont file');
	if (type == 2 && !_WMP_LoadMidi(fn, ptr, contents.length)) alert('Error loading MIDI file');
	_free(ptr);
	_free(fn);
}
